import React, { useState } from 'react';
import { 
  Typography, 
  Button, 
  Tooltip, 
  CircularProgress, 
  IconButton,
  Popover,
  Box,
  Paper
} from '@mui/material';
import InfoIcon from '@mui/icons-material/Info';
import SearchIcon from '@mui/icons-material/Search';
import axios from 'axios';

/**
 * Component for displaying and looking up BOM-managed dependency versions
 * 
 * @param {Object} props - Component props
 * @param {string} props.version - The version string (may include "MANAGED_BY_BOM")
 * @param {string} props.groupId - The Maven group ID
 * @param {string} props.artifactId - The Maven artifact ID
 * @param {string} props.estimatedVersion - Optional estimated version
 */
const BomManagedVersion = ({ version, groupId, artifactId, estimatedVersion }) => {
  const [anchorEl, setAnchorEl] = useState(null);
  const [lookupVersion, setLookupVersion] = useState(null);
  const [lookupLoading, setLookupLoading] = useState(false);
  const [lookupError, setLookupError] = useState(null);

  const isBomManaged = version && version.includes('MANAGED_BY_BOM');
  const hasEstimatedVersion = isBomManaged && estimatedVersion;

  // If not BOM managed, just display the version as-is
  if (!isBomManaged) {
    return <Typography>{version}</Typography>;
  }

  const handleInfoClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleInfoClose = () => {
    setAnchorEl(null);
  };

  const handleLookupVersion = async () => {
    if (lookupVersion || lookupLoading) return;

    setLookupLoading(true);
    setLookupError(null);

    try {
      // Call the Maven API endpoint to look up the version
      const response = await axios.get('/api/maven/lookup', {
        params: {
          groupId,
          artifactId,
          // We could also send parent information if available in props
          // parentGroupId: parentGroupId,
          // parentArtifactId: parentArtifactId,
          // parentVersion: parentVersion
        }
      });

      if (response.data && response.data.success) {
        setLookupVersion(response.data.version);
      } else {
        setLookupError(response.data.version || "Could not determine version");
      }
    } catch (error) {
      console.error("Error looking up version:", error);
      setLookupError(error.response?.data?.message || "Error looking up version");
    } finally {
      setLookupLoading(false);
    }
  };

  const popoverOpen = Boolean(anchorEl);
  const popoverId = popoverOpen ? 'bom-version-popover' : undefined;

  return (
    <>
      <Box sx={{ display: 'flex', alignItems: 'center' }}>
        <Typography 
          sx={{ 
            fontStyle: 'italic',
            color: hasEstimatedVersion ? 'text.primary' : 'text.secondary' 
          }}
        >
          {hasEstimatedVersion 
            ? `MANAGED_BY_BOM (est. ${estimatedVersion})` 
            : version
          }
        </Typography>

        <IconButton 
          size="small" 
          onClick={handleInfoClick}
          sx={{ ml: 0.5 }}
          aria-describedby={popoverId}
        >
          <InfoIcon fontSize="small" color="action" />
        </IconButton>
      </Box>

      <Popover
        id={popoverId}
        open={popoverOpen}
        anchorEl={anchorEl}
        onClose={handleInfoClose}
        anchorOrigin={{
          vertical: 'bottom',
          horizontal: 'left',
        }}
        transformOrigin={{
          vertical: 'top',
          horizontal: 'left',
        }}
      >
        <Paper sx={{ p: 2, maxWidth: 400 }}>
          <Typography variant="subtitle2" gutterBottom>
            Dependency Version Information
          </Typography>

          <Typography variant="body2" paragraph>
            This dependency is managed by a Bill of Materials (BOM), which means its version
            is defined in a parent POM or dependency management section rather than being explicitly specified.
          </Typography>

          {hasEstimatedVersion && (
            <Typography variant="body2" paragraph>
              <strong>Estimated version:</strong> {estimatedVersion}
              <br />
              <em>(Based on known BOM patterns)</em>
            </Typography>
          )}

          {lookupVersion ? (
            <Typography variant="body2">
              <strong>Actual version:</strong> {lookupVersion}
            </Typography>
          ) : lookupLoading ? (
            <Box sx={{ display: 'flex', alignItems: 'center', my: 1 }}>
              <CircularProgress size={16} sx={{ mr: 1 }} />
              <Typography variant="body2">Looking up version...</Typography>
            </Box>
          ) : lookupError ? (
            <Typography variant="body2" color="error" sx={{ my: 1 }}>
              {lookupError}
            </Typography>
          ) : (
            <Button
              startIcon={<SearchIcon />}
              size="small"
              variant="outlined"
              onClick={handleLookupVersion}
              sx={{ mt: 1 }}
            >
              Look up exact version
            </Button>
          )}
        </Paper>
      </Popover>
    </>
  );
};

export default BomManagedVersion;
